const Task = (props) =>{
    // Assuming task object has 'taskName' and 'id' properties
    const { taskName, id } = props.task;

    return(
        <div>
            <p>Task Name: {taskName}</p>
            <p>ID: {id}</p>
        </div>
    );
}

export default Task;
